import React, { useState } from "react";
import { useHistory } from "react-router-dom";


export default function Books() {
    const history = useHistory();
  const [data, setData] = useState([
    { id: 1, name: "card 1" },
    { id: 2, name: "card 2" },
    { id: 3, name: "card 3" },
  ]);

  const goToCard  =(id)=>{
    history.push(`/card/${id}`);
  }

  return (
    <div>
      {data.map((ele) => {
        return (
          <div onClick={()=>{goToCard(ele.id)}}>
            <h1>{ele.name}</h1>
          </div>
        );
      })}
    </div>
  );
}
